import React from 'react';
import './Division.css';
import backrib from './backrib.png';


const Division = (props)=>{
    return(    
      <div id = {props.id}  href={props.href}className="largeDiv">
      <h1 >{props.name}</h1>
      <h4>{props.title}</h4>
      <h5>{props.content}</h5>
      <img src={backrib} />
        </div>);

  }

  export default Division;
